PROPUESTA_GENERO:
- INICIAR LA REFORMA INTEGRAL A LA LEGISLACIÓN NACIONAL EN MATERIA  DE DISCAPACIDAD.
- ELABORAR  LOS PROYECTOS DE INICIATIVAS DE LEY QUE SEAN NECESARIAS  PARA INICIAR LA ARMONIZACIÓN  LEGISLATIVA QUE REQUIERE LA CONVENCIÓN INTERNACIONAL SOBRE LOS DERECHOS DE LAS ERSONAS CON DISCAPACIDAD DE LAS NACIONES UNIDAS.
- ELABORAR  ENTRE OTROS,  LOS PROYECTOS DE INICIATIVAS DE LEY QUE MODIFIQUEN Y REFORMEN LAS SIGUEINTES LEYES:
- CONSTITUCIÓN POLITICA  DE LOS ESTADOS UNIDOS MEXICANOS;
- LEY FEDERAL DEL TRABAJO;
¿ LEY GENERAL DE DEUCACIÓN;
- LEY GENERAL DE SALUD;
¿ LEY DE OBRAS PÚBLICAS  Y SERVICIOS;
- LEY DE CULTURA  FÍSICA  Y DEPORTE;
·LEY DEL ISR;
- LEY GENERAL PARA LA INCLUSIÓN Y PROTECCIÓN DE LAS PERSONAS  CON DISCAPACIDAD;
¿ LEY GENERAL DE PARTIDOS POLITICOS;
- CODIGO DE INSTITUCIONES Y PROCEDIMIENTOS  ELECTORALES;
- COMPENDIO DE LEYES FEDERALES Y GENERALES  EN MATERIA CIVIL Y PENAL.

TODAS LAS INICIATIVAS QUE SE PRESENTEN TENDRAN  INTEGRAMENTE UNA VISIÓN DE GENERO.
